import React from 'react';
import './Loader.css';

const Loader = () => {
  return (
    <div className="loader-container">
    <div className="loader">
      <div className="bounce"></div>
      <div className="bounce"></div>
      <div className="bounce"></div>
    </div>
  </div>
  );
};

export default Loader;
